                // While Loop

contract  property {
    
    uint[4] public arr=[1,2,3,4];
    uint public sum;


    function loop() public {
        uint count=0;
        while (count<arr.length){
            sum=sum+arr[count];
            count++;  //count=count+1

        }
    }
}

    //For loop
    contract  property1 {
    
    uint[4] public arr=[1,2,3,4];
    uint public sum;

    function loop() public {
        for(uint count=0;count<arr.length;count++){
            sum=sum+arr[count];
        }
    }
    }



